import React from 'react'
import { AiFillCaretLeft,AiFillCaretRight} from "react-icons/ai";


function Start({number,plus,miners,resetNumber,maxNumber,minNumber}) {
  console.log(number)
  return (
    <><div className='Start'>
      <button onClick={miners}disabled={number >= maxNumber} className='miners'><AiFillCaretLeft /></button>
      {number}
      <button onClick={plus}disabled={number <= minNumber} className='plus'><AiFillCaretRight /></button>
      <button onClick={resetNumber} >reset</button>
    </div></>
  )
}

export default Start
